      out.write("<script>\r\n");
      out.write("    $(document).ready(function () {\r\n");
      out.write("        function getMessageContent(messageId, event) {\r\n");
      out.write("            fetch('csvdata?id=' + messageId)\r\n");
      out.write("                .then(response => response.json())\r\n");
      out.write("                .then(data => {\r\n");
      out.write("                    if (data.message) {\r\n");
      out.write("                        let swalOptions = {\r\n");
      out.write("                            title: data.message,\r\n");
      out.write("                            confirmButtonText: \"OK\"\r\n");
      out.write("                        };\r\n");
      out.write("\r\n");
      out.write("                        // Kiểm tra các loại thông báo\r\n");
      out.write("                        if (messageId === \"SUCCESS_CREATE_NEW_PROMOTION\" || messageId === \"SUCCESS_UPDATE_PROMOTION\") {\r\n");
      out.write("                            swalOptions.icon = \"success\";  // Biểu tượng success\r\n");
      out.write("                        } else if (messageId === \"DUPLICATE_PROMOTION\" || messageId === \"FAIL_UPDATE_PROMOTION\") {\r\n");
      out.write("                            swalOptions.icon = \"error\";  // Biểu tượng error\r\n");
      out.write("                        } else {\r\n");
      out.write("                            swalOptions.icon = \"info\";   // Biểu tượng mặc định\r\n");
      out.write("                        }\r\n");
      out.write("\r\n");
      out.write("                        // Hiển thị thông báo với Swal\r\n");
      out.write("                        Swal.fire(swalOptions)\r\n");
      out.write("                            .then((result) => {\r\n");
      out.write("                                if (result.isConfirmed) {\r\n");
      out.write("                                    // Chuyển hướng hoặc hành động sau khi nhấn OK nếu cần\r\n");
      out.write("                                    if (messageId === \"SUCCESS_CREATE_NEW_PROMOTION\" || messageId === \"SUCCESS_UPDATE_PROMOTION\") {\r\n");
      out.write("                                        window.location.href = \"list_promotion\";\r\n");
      out.write("                                    }\r\n");
      out.write("                                }\r\n");
      out.write("                            });\r\n");
      out.write("                        event.preventDefault();\r\n");
      out.write("                    } else {\r\n");
      out.write("                        Swal.fire(\"Message not found\");\r\n");
      out.write("                        event.preventDefault();\r\n");
      out.write("                    }\r\n");
      out.write("                })\r\n");
      out.write("                .catch(error => {\r\n");
      out.write("                    console.error(\"Error: \", error);\r\n");
      out.write("                });\r\n");
      out.write("        }\r\n");
      out.write("\r\n");
      out.write("        $(\"#promotionForm\").submit(function (event){\r\n");
      out.write("            event.preventDefault();\r\n");
      out.write("\r\n");
      out.write("            const promotionId = $(\"#promotionId\").val();\r\n");
      out.write("            const description = $(\"#description\").val();\r\n");
      out.write("            const maxDiscount = parseFloat($(\"#maxDiscount\").val());\r\n");
      out.write("            const type = document.getElementById(\"type\").value;\r\n");
      out.write("            const status = $(\"#status\").val();\r\n");
      out.write("            const quantityInStock = parseInt($(\"#quantityInStock\").val());\r\n");
      out.write("            const priceLimit = parseFloat($(\"#priceLimit\").val());\r\n");
      out.write("            const percent = parseFloat($(\"#percent\").val());\r\n");
      out.write("            // Fetch raw date inputs\r\n");
      out.write("            const startDate = $(\"#startDate\").val();\r\n");
      out.write("            const endDate = $(\"#endDate\").val();\r\n");
      out.write("\r\n");
      out.write("            var specialSymbolsAndNumbersRegex = /[!@#^&*()_+\\-=\\[\\]{};':\"\\\\|<>\\/?]+/;\r\n");
      out.write("\r\n");
      out.write("            if (!promotionId || promotionId.trim() === \"\") {\r\n");
      out.write("                getMessageContent(\"NOT_NULL_PROMOTION\", event);\r\n");
      out.write("                $(\"#promotionId\").focus();\r\n");
      out.write("                return\r\n");
      out.write("            }\r\n");
      out.write("            else if(promotionId.length >20){\r\n");
      out.write("                getMessageContent(\"OVER_LENGTH_FIELD_PROMOTION\", event);\r\n");
      out.write("                $(\"#promotionId\").focus();\r\n");
      out.write("                return;\r\n");
      out.write("            }\r\n");
      out.write("            else if(specialSymbolsAndNumbersRegex.test(promotionId.trim())){\r\n");
      out.write("                getMessageContent(\"NO_ITALIC_CHARACTER_FIELD_PROMOTION\", event);\r\n");
      out.write("                event.preventDefault();\r\n");
      out.write("                $(\"#promotionId\").focus()\r\n");
      out.write("                return\r\n");
      out.write("            }\r\n");
      out.write("            else if (!description || description.trim() === \"\") {\r\n");
      out.write("                getMessageContent(\"NOT_NULL_DESCRIPTION\", event);\r\n");
      out.write("                $(\"#description\").focus();\r\n");
      out.write("                return;\r\n");
      out.write("            }\r\n");
      out.write("            else if (description.length >200){\r\n");
      out.write("                getMessageContent(\"OVER_LENGTH_FIELD_DESCRIPTION\", event);\r\n");
      out.write("                $(\"#description\").focus();\r\n");
      out.write("                return;\r\n");
      out.write("            }\r\n");
      out.write("            else if(specialSymbolsAndNumbersRegex.test(description.trim())){\r\n");
      out.write("                getMessageContent(\"NO_ITALIC_CHARACTER_FIELD_DESCRIPTION\", event);\r\n");
      out.write("                event.preventDefault();\r\n");
      out.write("                $(\"#description\").focus()\r\n");
      out.write("                return\r\n");
      out.write("            }\r\n");
      out.write("            else if (!startDate || !endDate) {\r\n");
      out.write("                getMessageContent(\"NOT_NULL_DATE\", event);\r\n");
      out.write("                event.preventDefault();\r\n");
      out.write("                return\r\n");
      out.write("            }\r\n");
      out.write("            else if (startDate >= endDate) {\r\n");
      out.write("                getMessageContent(\"ILLOGICAL_DATE_FIELD\", event);\r\n");
      out.write("                event.preventDefault();\r\n");
      out.write("                $(\"#startDate\").focus()\r\n");
      out.write("                return\r\n");
      out.write("            }\r\n");
      out.write("            else if (type.trim() === \"\") {\r\n");
      out.write("                getMessageContent(\"NOT_NULL_PROMOTION_TYPE\", event);\r\n");
      out.write("                event.preventDefault();\r\n");
      out.write("                $(\"#type\").focus()\r\n");
      out.write("                return\r\n");
      out.write("            }\r\n");
      out.write("            else if (isNaN(percent)) {\r\n");
      out.write("                getMessageContent(\"NOT_NULL_DISCOUNT_RATE\", event);\r\n");
      out.write("                event.preventDefault();\r\n");
      out.write("                $(\"#percent\").focus()\r\n");
      out.write("                return\r\n");
      out.write("            }\r\n");
      out.write("            else if (percent <= 0 || percent > 100) {\r\n");
      out.write("                getMessageContent(\"ERROR_NUM_FIELD_DISCOUNT_RATE\", event);\r\n");
      out.write("                event.preventDefault();\r\n");
      out.write("                $(\"#percent\").focus()\r\n");
      out.write("                return\r\n");
      out.write("            }\r\n");
      out.write("            else if (isNaN(maxDiscount)) {\r\n");
      out.write("                getMessageContent(\"NOT_NULL_MAX_DISCOUNT\", event);\r\n");
      out.write("                event.preventDefault();\r\n");
      out.write("                $(\"#maxDiscount\").focus()\r\n");
      out.write("                return\r\n");
      out.write("            }\r\n");
      out.write("            else if (maxDiscount <= 0) {\r\n");
      out.write("                getMessageContent(\"ERROR_NUM_FIELD_MAX_DISCOUNT\", event);\r\n");
      out.write("                event.preventDefault();\r\n");
      out.write("                $(\"#maxDiscount\").focus()\r\n");
      out.write("                return\r\n");
      out.write("            }\r\n");
      out.write("            else if (isNaN(priceLimit)) {\r\n");
      out.write("                getMessageContent(\"NOT_NULL_PRICE_LIMIT\", event);\r\n");
      out.write("                event.preventDefault();\r\n");
      out.write("                $(\"#priceLimit\").focus()\r\n");
      out.write("                return\r\n");
      out.write("            }\r\n");
      out.write("            else if (priceLimit <= 0) {\r\n");
      out.write("                getMessageContent(\"ERROR_NUM_FIELD_PRICE_LIMIT\", event);\r\n");
      out.write("                event.preventDefault();\r\n");
      out.write("                $(\"#priceLimit\").focus()\r\n");
      out.write("                return\r\n");
      out.write("            }\r\n");
      out.write("            else if (isNaN(quantityInStock)) {\r\n");
      out.write("                getMessageContent(\"NOT_NULL_QUANTITY_IN_STOCK\", event);\r\n");
      out.write("                event.preventDefault();\r\n");
      out.write("                $(\"#quantityInStock\").focus()\r\n");
      out.write("                return\r\n");
      out.write("            }\r\n");
      out.write("            else if (quantityInStock <= 0) {\r\n");
      out.write("                getMessageContent(\"ERROR_NUM_FIELD_QUANTITY_IN_STOCK\", event);\r\n");
      out.write("                event.preventDefault();\r\n");
      out.write("                $(\"#quantityInStock\").focus()\r\n");
      out.write("                return\r\n");
      out.write("            }\r\n");
      out.write("\r\n");
      out.write("            // Xác định chế độ Update hay Create\r\n");
      out.write("            const isUpdate = ");
      out.write((java.lang.String) org.apache.jasper.runtime.PageContextImpl.proprietaryEvaluate("${sessionScope.isUpdate}", java.lang.String.class, (javax.servlet.jsp.PageContext)_jspx_page_context, null));
      out.write(";\r\n");
      out.write("\r\n");
      out.write("            // In ra giá trị cho debug\r\n");
      out.write("            console.log(\"Promotion ID:\", promotionId);\r\n");
      out.write("            console.log(\"isUpdate:\", isUpdate);\r\n");
      out.write("\r\n");
      out.write("            // Xác định URL dựa trên chế độ\r\n");
      out.write("            const url = isUpdate ? \"update_promotion\" : \"create_promotion\";\r\n");
      out.write("\r\n");
      out.write("            $.ajax({\r\n");
      out.write("                url: url,\r\n");
      out.write("                type: \"POST\",\r\n");
      out.write("                data:{\r\n");
      out.write("                    promotionId,\r\n");
      out.write("                    description,\r\n");
      out.write("                    maxDiscount,\r\n");
      out.write("                    quantityInStock,\r\n");
      out.write("                    priceLimit,\r\n");
      out.write("                    percent,\r\n");
      out.write("                    startDate,\r\n");
      out.write("                    endDate,\r\n");
      out.write("                    status,\r\n");
      out.write("                    type,\r\n");
      out.write("                    // startDate,\r\n");
      out.write("                    // endDate,\r\n");
      out.write("                },\r\n");
      out.write("                success: function (response){\r\n");
      out.write("                    if(!response.valid){\r\n");
      out.write("                        const message1 = isUpdate ? \"FAIL_UPDATE_PROMOTION\" : \"DUPLICATE_PROMOTION\";\r\n");
      out.write("                        getMessageContent(message1, event)\r\n");
      out.write("                    }else{\r\n");
      out.write("                        const message = isUpdate ? \"SUCCESS_UPDATE_PROMOTION\" : \"SUCCESS_CREATE_NEW_PROMOTION\";\r\n");
      out.write("                        getMessageContent(message, event)\r\n");
      out.write("                    }\r\n");
      out.write("                },\r\n");
      out.write("                error: function (){\r\n");
      out.write("                    getMessageContent(\"PERSIT_ERROR\",event);\r\n");
      out.write("                }\r\n");
      out.write("            })\r\n");
      out.write("        });\r\n");
      out.write("        $(\"#promotionForm\").validate({\r\n");
      out.write("            rules:{\r\n");
      out.write("                promotionId: \"required\",\r\n");
      out.write("                description: \"required\",\r\n");
